Tout document de votre accueillant européen permettant de justifier de la réalité des ressources possédées et de la durée pendant laquelle il en disposera.

Exemples :

Attestation d'emploi datée de  - de 3 mois établie par son employeur ;

justificatif de maintien de droit ;

relevés de compte bancaire, bulletins de pension ;

Exercice d’une activité non salariée :Tout document relatif à l'exercice régulier, effectif et durable de l'activité, selon la nature de celle-ci : immatriculation aux  registres légaux (registre du commerce et des sociétés ou répertoire des métiers), affiliation à des organismes professionnels et à des organismes de sécurité sociale, souscription d'assurances, procès verbal de nomination, bail professionnel, factures d'achat de matériels, contrats de ventes, contrats de prestations, formulaire de déclaration de chiffre d'affaires, livre des recettes et des achats, etc.

Montant exigé : équivalent  au RSA ou ASPA, calculé en fonction de la composition de la famille.

à l’exclusion des prestations sociales ou allocation
Pour les familles de 2 à 3 personnes : au moins le niveau du SMIC; 
Pour les familles de 4 à 5 personnes : au moins le niveau du SMIC + 10%; 
Pour les familles de plus de 5 personnes : au moins le niveau du SMIC + 20%.
Par exemple : bulletins de paye, avis d'imposition, attestation de versement de pension, contrat de travail, attestation bancaire...

Un dossier .Zip regroupant :
1. Délibération de la collectivité sur le projet ;
2. Attestation de propriété du terrain ;
3. Permis d'aménager ;
4. Plan de situation de l'aire ;
5. Notice descriptive du projet de réhabilitation ;
6. Plan de financement prévisionnel du projet (HT et TTC) ;
7. Attestation de non commencement d'opération avant le dépôt du dossier de demande de subvention ;
8. Relevé d’identité bancaire.

Pour justifier de l’acquittement des dépenses, 3 possibilités : 
-	Faire signer les factures par les fournisseurs : Dans ce cas, la mention « acquittée le… » avec la date d’acquittement ainsi que le moyen de paiement et la signature du fournisseur doivent apparaître sur les factures ;
-	Transmettre les relevés bancaires : transmettre les relevés bancaires en mettant en surbrillance les montants des factures ;
-	Transmettre un tableau récapitulatif détaillé des factures certifiées par le commissaire aux comptes ou l’expert-comptable faisant apparaitre le cachet, le nom et la signature.

Lorsque la facture concerne plusieurs dépenses dont certaines ne sont pas éligibles, il convient d’indiquer sur la copie de la facture ceux qui sont éligibles (par exemple en surlignant les montants à prendre en compte).

- Assurance maladie couvrant la durée du séjour ;
- Justification de moyens d'existence suffisants : si vous êtes boursier du gouvernement français ou bénéficiaire de programmes européens : un justificatif de cette situation ; si vous êtes boursier dans votre pays d'origine : l'attestation de bourse de l'organisme payeur du pays d'origine précisant le montant et la durée de la bourse ; si vous travaillez : vos trois dernières fiches de paie ; si vous êtes pris en charge par un tiers : les attestations bancaires de virements réguliers ou une attestation sur l'honneur de versement des sommes permettant d'atteindre le montant requis ; si vous disposez de ressources
suffisantes : l’attestation bancaire de solde créditeur suffisant ; en cas de ressources multiples veuillez joindre le justificatif de chacune des ressources ;
